(37, 5300, '', 0, '', 1000, 'I intend to include 20+ schools, with varying distances to each.\n\nEach site would require two visits.\n\nWe would utilize the campus car pool several times each week', 0, '', 300, 'Copies of Early Childhood Environmental Ed. Rating Scale, $200; \nCopying and mailing costs, $100', 0, ''),
(38, 5300, 'Yes, I would like this for my time.', 0, 'No travel will be required on a regular basis unless we do a one time trip to OSU to work with Grandinetti and then that will be covered under the previously mentioned travel line.', 1500, 'We may go to OSU to work with Grandinetti lab for a period of time.  We also will be attending an off-campus conference in the Spring of 2018 after the work is finished.', 700, 'Additional magic-angle spinning rotor, repair of Pt crucible as they wear out', 800, 'Chemicals for phosphate and silicate sample preparation.', 0, ''),
