(49, 5300, 'Maggie Robillard, eight week leadership of URCPP.', 613, 'Travel to Appalachian Studies Association member Colleges ', 700, 'Travel to Appalachian Studies Association member colleges'' academic libraries (Appalachian State University and University of Kentucky) for information about the priorities of regional experts also interested in Appalachian research and scholarship. Includes meals and hotel costs where applicable.', 0, '', 2200, 'Appalachian materials (texts and other published works), labeling supplies, library materials such as bookends and signage.', 0, ''),
(50, 5300, '$5300.00. Stipend for one faculty member.', 1500, 'Students will have to travel to producer operations for four weeks (weeks 1, 3, 5, and 7) and to meet with extension personnel, representatives from relevant agencies and other collaborators. In addition, students will travel to All-tech research lab where they will be trained and utilize laboratory equipment for invitro digestibility and forage analysis. Therefore, an estimated average of 375 miles will be covered in each of these weeks for a total travel of about 1500miles throughout the duration of this project. Hence, budgeted allocation for travel is 1500 X $0.49 = $735.00', 0, '', 1000, 'Purchase of an ultrasound probe will allow for training students in ultrasonography, thus providing them with invaluable research skills and experiences that will prompt their interest in graduate school. The ultrasound probe will be used for conducting early pregnancy diagnosis, detecting early pregnancy losses and monitoring of ovarian activity to ascertain reproductive performance in cattle, which is at the core of the project. It is estimated that this probe will cost $1000.00', 300, 'Forage analysis will be conducted with the assistance of the All-Tech research lab, but the initial packaging and processing of the forage will be done in the Animal Science Lab in the Agriculture building at Berea College. Hence, the need to purchase materials for forage analysis is necessary and funds are being requested in the amount of $300.00.', 200, 'Miscellaneous items'),
(52, 5300, 'Jan Pearce is requesting $5,300 to work on this project as a project director and mentor for 4 students for 10 weeks.', 360, '4 round trips to the University of Kentucky in Lexington to meet in person with Dr. Judy Goldsmith and her research team.', 40, 'Parking at the University of Kentucky for collaboration with Dr. Goldsmith''s research group. Four days of parking at $10 per day.', 0, 'No additional equipment is needed. The computer science department has a server which we will use for our work.', 0, 'No additional materials are requested.', 2500, 'Funding for student and my participation in a paper or poster session at a regional professional conference such as the Kentucky Academy of Science Annual Meeting (typically the first week in November. See https://www.kyscience.org/kas_annual_meeting.php) or a regional computer science conference such as the Consortium for Computing in Colleges Southeastern Region (typically in the first or second week of November. See http://www.ccscse.org/pastyears.php.)  Since the conferences changes venues each year, and the 2018 venues have not been announced, budgeting is more challenging. Hence, I  allocated $500/person.\r\n'),
(53, 5300, 'Two full-time, tenure-track faculty members', 966, 'From Berea, students and the researchers will be traveling 69 miles each way on the seven days that we will be gathering data from participants. ', 0, '', 2495, 'To allow for maximum participation, rock climbing gear such as harnesses, carabiners, ropes and shoes may need purchased. This is a one-time purchase to be used for future projects. ', 0, 'All materials needed (accelerometers, computer and software) are already purchased. ', 0, ''),
(54, 5300, 'One faculty ', 2952, ' Researcher and students would travel to following towns : Richmond, Winchester, Irvine, Lancaster, Annville, and mount Vernon. Please see more details in the project narrative.', 1476, '3 people drive separately = 164 miles x 2 x 3 x 3  @ $.50/miles', 0, '0', 400, 'Candy, pen, sticky pads, other material to attract research subjects	$400.00\r\nTwo computers, printing of instrument, Research flyers, \r\nFolding desk to put stall for data collection - official support. For this budget is not requested.\r\n', 700, 'Incentive to per participant:  140 participants X $5.00 \r\n'),
(55, 5300, 'Lisa Marks - $5300', 0, '', 0, '', 0, '', 3000, 'Each project will need significant material to explore and produce the selected craft and produce a design object.  The specifics of the needed material will be driven by the project, but this will allow $750 per craft.  This is a very low budget for a design project.', 0, ''),
(56, 5300, '$5300 for Amanda Wyrick', 1222, 'Students and faculty will travel to and from White House Clinic Locations to collect research data. ', 2000, 'Students and faculty with travel to APA in August 2018 for student professional development and to learn more about research and career opportunities in health psychology. This allows the faculty to mentor students regarding conference attendance and networking even when not presenting. Funding will also cover attendance at the KPA Spring Academic Conference. ', 0, '', 400, 'Some copies of articles and assessment instruments will need to be made. In addition, posters will need to printed for BURS and KPA Spring Academic Conference. ', 0, ''),
(57, 5300, 'I will be on-site at the CDL at least 24 hours per week. The remaining hours of the work week I will be in my office working on developing the training and other tasks related to data analysis.', 425, 'See above for price (included in travel).', 700, 'This travel would be to a conference over the summer. I will submit a presentation for the conference that will include the students as presenters. This particular conference has a 2-day session of Reggio presenters. We will submit to that section of the conference.', 0, '', 550, 'This is for training materials.', 0, 'n/a'),
(58, 5300, '', 0, '', 400, '	Travel to the 2018 KAS Meeting \r\n	(Meeting Dues+1-night stay+ transportation expenses)\r\n	(Approximate amount)\r\n', 0, '', 2200, '25 mm (0.98") One-Axis Motorized Translation Stage, 1/4"-20 Taps 		824$ \r\nK-Cube Brushed DC Servo Motor Controller (Power Supply Not Included) 	626$\r\n15 V, 2.4 A Power Supply Unit for One K-Cube or T-Cube 				26$\r\nRight-Angle Bracket for PT Series Translation Stages, 1/4"-20 Mounting Holes 74$\r\n3 Quarter Wave plate with Mounting                                                                	650$\r\n	\r\n', 0, ''),
(59, 5300, '1 Facutly member, $5300 stipend', 0, 'No miles necessary to conduct research.', 0, 'No travel necessary to conduct research.', 0, 'No equipment will be necessary for this project.', 0, 'The only necessary materials will be pencils, paper, computers, and free software.  ', 250, 'Ordering one book from the bibliography (Lessons in Play by Michael H. Albert) for each of 4 students.  This figure is based on the approximate price+shipping value on amazon.com for a used copy of the book as of 01/08/18.'),
