(66, 5300, 'I will be conducting this research alone without additional faculty participation', 800, 'Eight trips to North Elkhorn Creek in a 12 Passenger Van - the round trip is approximately 98 miles\r\nWisconsin Trip - around 400 miles', 800, 'BURS and KAS will be on campus this coming year, so this will just include the cost of registration; if students are available during early June 2020, there may be an opportunity to have them present at the Annual Midwestern Conference of Parasitologists which will be held in, I believe, Wisconsin which will entail additional  mileage indicated here.', 250, 'Fishing Equipment - Rods, reels, lures (we may be able to have a local resident who lives at the site - Bryan Hollingsworth -  procure some of these fish for us, but we will likely have to angle for some on our own)\r\n\r\n\r\n', 1000, 'Chemicals - for preparation of histological sections, permanent slides and  several experiments with living material\r\nGlassware - slides and coverslips\r\n', 550, 'Meeting Registrations and Hotel Rooms'),
(67, 5300, 'This project includes one faculty member (Dr. Troy Messina) receiving a stipend of $5300.', 70, 'We will likely take one trip to the University of Kentucky to make alloys.', 1000, 'The Kentucky Academy of Science meeting is at Berea College next year. No travel funds are necessary for this meeting. However, we would like to have travel money to attend the American Physical Society March Meeting in Denver, Colorado March 2-6, 2020.', 500, '  We will likely need to design or modify equipment for our experiments.  The existing equipment in physics is not completely adapted for making measurements across all temperatures we wish to study. When making new alloys, we typically supply our own expendables to the UK lab where we make the alloys.', 1500, 'We will need to purchase some high purity metals. The research requires material purity of 99.99% or greater when possible. These metals can be quite expensive even in small quantities.', 0, 'N/A'),
(68, 5300, '$5300', 0, '', 0, '', 0, 'I have received external funding from the National Science Foundation that will cover the labor of 2 students, as well as equipment and materials. I am only asking URCPP for a faculty stipend and labor for 3 additional students.', 0, 'please see above', 0, ''),
