(74, 5300, '$5300  (While Dr. Meghan Doherty is eligible for participating in the URCPP, they not eligible for the stipend due to the terms of their contract, which is why only one stipend is included here). ', 600, 'For day trips to area museums, including the Speed Museum in Louisville, the Contemporary Art Center in Cincinnati, and Memorial Hall at the University of Kentucky, for students to engage directly with different approaches of curation and exhibition design and implementation', 200, 'Car rental and food for day trips to area museums, including the Speed Museum in Louisville, the Contemporary Art Center in Cincinnati, and Memorial Hall at the University of Kentucky, for students to engage directly with different approaches of curation and exhibition design and implementation', 0, 'All equipment will be available in the Sculpture Space and in the Doris Ulmann Galleries. ', 2000, '-$500 for final-version supplies: lumber (oak, cherry, maple), maple plywood, and woodworking supplies (nails, glue, etc.)\r\n-$500 for materials for prototyping different apparatuses: 2x4s, pine plywood, OSB, etc.\r\n-$300 for material for cases designed to house portraits: steel, Plexiglas\r\n-$500 for various museum-grade hardware and locking mechanisms for securing portraits to walls, including casters, latches, \r\n-$200 for finish materials (lacquer, paint, etc.)\r\n', 500, '$500 to print signage related the exhibition. For this exhibition it will be important that the signage must be professionally printed and mounted on foam-core, as the resulting exhibition will be held to the same standards as other shows in the Doris Ulmann Galleries. It should be noted that for this exhibition there will likely be more than ten large-scale posters with information created throughout the gallery space. '),
