INSERT INTO `budget` (`bID`, `facultyStipend`, `facultyStipendDesc`, `miles`, `milesDesc`, `otherTravel`, `otherTravelDesc`, `equipment`, `equipmentDesc`, `materials`, `materialsDesc`, `other`, `otherDesc`) VALUES
(342, 5300, '5300', 0, '', 500, 'Travel to University of Louisville Moore Observatory $150Travel to 2015 KAS, including hotel and meals $350', 1420, 'H-alpha filter for CCD camera $800Maxim DL software license $600USB extension cable $20', 125, 'Photocopying $100Lab notebooks $25', 0, ''),
(343, 5300, 'JHB @ $5300', 0, '', 850, '47th Southeast Undergraduate Research Conference (http://chemistry.gsu.edu/2013/06/19/48th-annual-southeast-regional-acs-undergraduate-research-conference/) in Atlanta GA, driving 344 miles ($350 total), hotel for 2 students and faculty member for 2 nights ($400 total), registration ($100 total).', 1250, 'MAS rotor/cap ($500)Crystal Maker 9 software ($500, http://www.crystalmaker.com/)Crystal Diffract 6 software ($250)', 500, 'Phosphate salts for synthesis', 80, 'Food for students'),
(344, 10600, 'Matt Jadud, Scott Heggen', 0, '', 400, 'We would like to take the group to one, if possible two research institutions during the summer. We have good connections at the University of Kentucky, Louisville, and Indiana in areas related to these projects. The most likely, at the time of our proposal, is to take a day-trip to the University of Louisville. At 300 miles (round-trip), we are off-the-cuff estimating a $400 budget for the entire team to travel (via school van), plus food.', 2400, 'Software Systems and Integration ($1000)The Computer Science department took possession of 96 rack-mount servers as part of a donation; this hardware infrastructure is estimated as being worth approximately $115,000. These machines lack hard drives, and we are in need of a switch to do any cluster research with them. We will not be provisioning all 96 machines under the rubric of URCPP. We would like to bring up a cluster of 8 machines (the smallest meaningful cluster we can imagine) with two drives each, requiring $800. A switch runs $100; cabling and other components will add another $100. Open Hardware for Sensing ($800)Many of the materials needed for this work is available in the electronics laboratory already. Raw materials for circuit prototyping, additional wireless radios for testing, and support for producing a small number of test boards would be ideal. The one tool that is desperately needed for this work is a logic analyzer, which can capture digital signals, record them, and allow for on-screen analysis after-the-fact. The Salae Logic 8 Pro ($299) is an extremely capable (and affordable) logic analyzer that we have identified for supporting this work.Quadruped Robotics ($600)One of the largest costs in robotics are precise, high-torque servo motors. While we can (and will) prototype with low-cost, low-torque micro servos, these are unlikely to be capable enough for a walking robotics projects. High-torque servo motors run between $20 and $60 each; typical leg designs require 2-3 servos per leg. We are budgeting for servos and materials for laser cutting robot bodies as well as 3D printing on both our consumer- and professional grade printers.', 0, '', 0, ''),
(345, 5300, 'G. Neil Douglas, Ph.D.', 0, '', 104, 'Travel to and from Harrogate, Claiborne Co., TN (200 miles round trip)', 0, '', 317, '1 Owl pellet kit for training students ($71.95)10 Aluminum pans ($17 each)150 plastic sample jars (0.50 each) ', 0, ''),
(346, 5300, 'Patrick Mineo: $5300.00', 0, '', 0, '', 1500, 'Homogenizer', 1500, 'Enzymes and reagents: $1400.00Research conference expenses: $100.00', 0, ''),
(347, 5300, '5300', 0, '', 530, 'Total travel to producer farms and other agencies is estimated at 1000 miles. Therefore total mileage is budgeted at 1000 x $0.53 = $530.00', 2217, 'Four video cameras at $218.00 each = $872.00, One Fecal Analysis Kit at $290.00, and One Binocular Compound Field Microscope Set at a cost of $1055.00. Therefore total cost = $2216.40', 253, 'Stationery at cost of $253.00', 0, ''),
(348, 5300, '5300', 0, '', 122, 'Round trip travel and lodging from Lexington for guest scientist	$122', 0, '', 519, 'Glucose oxidase	$81.20Laccase	$89.40ITO coated slides	$347.50', 120, 'Lab meal with guest at midterm of summer	$120'),
