(353, 5300, 'One Faculty member at $5,300', 0, '', 0, 'No travel incured', 2558, 'For the Infiltration measeurements:  4 Infiltration rings at $190 each, 4 rubber mallets at $26.50 each.  For microbial respiration:  8 cases of 12 wide mouth quart jars at $14 each.  Soil cores for bulk density sampling: 16 cores at $8.80 each.  For aggregate stability: 6 soil sieve sets at $149 each and a bench-top pH meter at 545$.  ', 221, 'For microbial respiration, NaOH pellets at $8.15 for 500g, 2.5 L of HCl for 37.50 and 500 g BaCl for $21.15.  For POxC Carbon measurement: potassium permanganate 500 g at $17.25, 100 each 50 ml and 15 ml centrifuge tubes at $73 and $63.90 respectively.  ', 0, ''),
