(362, 5300, 'I will be the sole faculty mentor on this project', 576, 'Twelve trips to collecting site at North Elkhorn Creek in Scott County, Kentucky', 800, '102nd  Annual Meeting of the Kentucky Academy of Science in Louisville, November 2016 & possibly the Annual Midwestern Conference of Parasitologists, June 2017', 400, 'Hip Boots', 1100, 'Chemicals to make artificial snail and pond water; microscope slides and coverslips; Kleermount; acetocarmine stain', 0, ''),
(363, 5300, 'I will be the only faculty member and am requesting the  full stipend.', 0, '', 0, '', 1000, 'The magnetometer will require modification to make it capable of varying the temperature. Parts for this modification are likely to cost $500. The AFM will require some electronic components likely to cost in the neighborhood of $250. There will be a variety of small pieces of equipment needed to make, transport, and store the alloys (diamond saw blade, vials, dessicants, etc.). These will cost approximately $250', 1500, 'Costs of metals:\n\nChromium (50 grams) $76\n\nCobalt (100 grams) $76\n\nIron (250 grams) $32\n\nNickel (100 grams) $38\n\nPalladium (5 grams) $400\n\nGold (5 grams) $580\n\nSilver (50 grams) $230\n\nCopper (50 grams) $33', 0, ''),
(364, 5300, 'Stipend per Faculty Member—$5,300', 0, 'N/A', 0, '', 1000, 'Miscellaneous equipment:\n\n	Motor 		$500\n\n	Controller		$300\n\n	Wiring/other		$200\n\n', 2000, 'Metal: \n\n	 To be determined\n\n	 Most likely a steel alloy \n\n	(will try to recycle)\n\n', 0, ''),
(365, 5300, '', 0, '', 1500, 'Kentucky Academy of Science (KAS) (Travel, Registration, Lodging and Meals) - $600\n\nHuman Anatomy and Physiology Conference - $900', 0, '', 1500, 'Supplies for Creative Manipulatives and Educational Games - $1200\n\nResearch Poster Printing - $200\n\nLaminator Pouches - $100', 0, ''),
(366, 5300, '1 @ 5,300', 0, 'NA', 480, 'Meeting expenses (KAS 2016)\n\n 		Poster printing  (2)			        $120\n\n 		KAS student registration (4)		$140 ($35 x 4)\n\n 		Hotel (2 rooms @ $110)			$220\n\n 		Subtotal						                                                    $480\n\n', 0, '', 2150, 'Materials and Supplies (List):\n\n		Bacterial culture supplies  (media, Petris)	$400\n\n 		Gene Clean Turbo kits (2)		                	$250\n\n 		MAX Efficiency® E. coli DH5? cells		        $250	\n\n 		Enzymes/primers (restriction, Taq, etc.)	         $300*\n\n 		EasyStart50 PCR tubes 			                         $250\n\n 		Gel electrophoresis supplies		                         $250\n\n 		Antibiotic test discs			                                 $200\n\n 		Disposables (e.g.dishes,pipette tips,\n\n		    microcentrifuge tubes, etc.)		                 $200\n\n 		Duplicating				                                         $50\n\n 		Subtotal						                                                         $2150\n\n\n\n*includes overnight delivery\n\n', 0, ''),
(367, 10600, '5300', 0, '', 0, '', 0, '\n\n', 150, 'Reflective Writing Journals - 100 journals\n\n', 1500, 'Cinemark Movie Tickets for participants - 100 participants\n\nCopies of Literature Review Articles '),
(368, 5300, 'Stipend for one faculty member', 490, 'We will have to travel to producer operations for four weeks (weeks 1, 3, 5, and 7) and to meet with extension personnel, representatives from relevant agencies and other interest groups. Therefore, an estimated average of 250 miles will be covered in each of these weeks for a total travel of about 1000 miles throughout the duration of this project. Hence, budgeted allocation for travel is 1000 X $0.49 = $490.00', 0, '', 0, '', 0, '', 0, ''),
(369, 5300, '', 0, 'Cost Included above', 1200, '  4 nights at hotels, 2 rooms for 3-4 adults	800\n\n  1 trip, transportation and board estimates	300\n\n', 1500, 'Website Design and implementation', 300, '  Books and Primary Materials	100 \n\n  Media Storage	200 \n\n', 0, ''),
