(372, 5300, '$5300 x 1 full-time faculty member', 0, 'We will use a CELTS van for transportation to and from research sites. ', 400, 'Conference registration and Berea car rental for two conferences (ASK and KAS): $400', 160, 'Scale for measuring food waste: $160 (http://www.globalindustrial.com/p/packaging/scales/floor/industrial-bench-floor-scale-330-lb)\n\n', 720, 'Photo copies: $300\n\nPoster presentation materials: $60\n\nTextbooks for summer research students ($120 x 3): $360\n\n', 0, ''),
