(374, 5300, '5300', 22, 'Most work will be done on the Berea College campus.  We may take a few visits up to UK to visit Robin Cooper''s neuroscience lab for some pointers on some equipment and technique.', 2500, 'I''m putting the maximum remainder down because it is my hope that we could present our work at the Faculty for Undergraduate Neuroscience sessions held in conjunction with the Society for Neuroscience Annual Meeting which will be held in San Diego the relevant year and will be expensive to attend.  I plan on using my own travel funds to supplement.  If this turns out to be impossible, travel funds will be used to present in more local venues (e.g. ACA Summit, SETOP in Atlanta, etc.)', 0, '', 500, 'Minimal equipment will be needed because will be able to draw on prior supplies.  Some small vibration motors, a variety of small implements (such as blunt probes for temperature perception testing on skin), and printing costs.', 0, ''),
