(379, 5300, 'One Faculty Member', 0, 'Chose to use Enterprise Rent-a-Car due to it being less expensive.', 2117, 'One Week Rental: Standard Size Vehicle from Enterprise Rent-a-Car: $198.18\n\nGas: ~$150 for round trip\n\nHotel Rental-- 2 Rooms total: \n\nOne Night: St. Louis, Missouri: Red Roof Inn--$52 per room, $104 total.\n\n	One Night: Bentonville, Arkansas: Days Inn and Suites--$54 per room, $108 total.\n\n	One Night: Amarillo, Texas: Red Roof Inn--$55 per room, $110\n\nThree Nights:Santa Fe, New Mexico; Days Inn and Suites--$51 per room per night, $306 total\n\nReturn Trip: Estimate $300 in hotel rooms over the course of three days, but stopping locations have not been determined yet. \n\n\n\nFood: $40 per day per person x 7 days: $280 Total x 3 people\n\n', 150, 'Laguna Resaw Bandsaw Blade: $150', 550, 'Supplementary White Oak; $3.00 per board Feet X 100: $300\n\n	Dimensional Pine Construction Lumber: $250\n\n', 18, 'Two Copies of  "Metaphor We Live By"'),
