(381, 5300, '5,300 for one faculty member', 110, '  Travel to field site:  28 miles round-trip with eight (8) trips\n\n  Rental of College vehicle (minivan) = $8.00 per day \n\n  (28 miles x $0.61/mile) x 8 + ($64 for eight rentals) =\n\n$0.61 per mile is the mileage rate for College minivans\n\n\n\nThe field site where the plants are located is 14 miles (one-way) away from campus.  A minivan is required to get to the field site due to the rugged terrain.  A car would "bottom-out" as they do not sit high enough to prevent dragging on the very rough gravel road that we have to travel to get to the site.  \n\n', 201, '', 205, '  Planting Trays for seeds/young seedlings ($70 per case)	$70.00 \n\n  Fertilizer mixture	$15.00 \n\n  Petri dishes  ($60 per case of 100 x 2)	$120.00\n\n', 68, '  Potting Soil ($8.00 per bag x 6 bags)	$48.00 \n\n  Soil fungi treatment mix	$20.00 \n\n', 230, '  Cost of printing posters (for presentation of research at the 	$160.00 \n\n  Kentucky Academy of Science annual meeting)	 \n\n  Cost of KAS registration for 2 students (2 x $35)	$70.00 \n\n'),
